export const addToken = (token) =>{
    return{
        type: "ADD_TOKEN",
        token
    };
};

export const setUsername = (username) =>{
    return{
        type: "SET_USERNAME",
        username
    };
};

export const setGroup = (group) =>{
    return{
        type: "SET_GROUP",
        group
    };
};

export const setIsOwner = (val) =>{
    return{
        type: "SET_ISOWNER",
        val
    };
};
